/* Link returns an HTML element that defines the relationship between a document and an external resource (most used to link to style sheets). */
func Link() HTMLLink {
	e := &htmlLink{
		htmlElement: htmlElement{
			tag:           "link",
			isSelfClosing: true,
		},
	}

	return e
}

