/* line returns an HTML element that The <line> element is an SVG basic shape used to create a line connecting two points. */
func line() HTMLline {
	e := &htmlline{
		htmlElement: htmlElement{
			tag:           "line",
			isSelfClosing: false,
		},
	}

	return e
}

