/* rect returns an HTML element that The <rect> element is a basic SVG shape that draws rectangles, defined by their position, width, and height. The rectangles may have their corners rounded. */
func rect() HTMLrect {
	e := &htmlrect{
		htmlElement: htmlElement{
			tag:           "rect",
			isSelfClosing: false,
		},
	}

	return e
}

