/* animate returns an HTML element that The SVG <animate> element provides a way to animate an attribute of an element over time. */
func animate() HTMLanimate {
	e := &htmlanimate{
		htmlElement: htmlElement{
			tag:           "animate",
			isSelfClosing: false,
		},
	}

	return e
}

