/* animateTransform returns an HTML element that The animateTransform element animates a transformation attribute on its target element, thereby allowing animations to control translation, scaling, rotation, and/or skewing. */
func animateTransform() HTMLanimateTransform {
	e := &htmlanimateTransform{
		htmlElement: htmlElement{
			tag:           "animatetransform",
			isSelfClosing: false,
		},
	}

	return e
}

